import React from "react";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

const ImageCarousel = () => {
  return (
    <Carousel autoPlay={true} interval={3000} showStatus={false} showThumbs={false}>
      <div>
        <img src="/imagenpi.png" alt="Proyecto Individual" />
      </div>
      <div>
        <img src="/pf2.png" alt="Proyecto Grupal 1" />
        <img src="/pf3.png" alt="Proyecto Grupal 2" />
        <img src="/pf4.png" alt="Proyecto Grupal 3" />
        <img src="/pf5.png" alt="Proyecto Grupal 4" />
      </div>
    </Carousel>
  );
};

export default ImageCarousel;
